import React from "react";
import "./CardItem.scss";
import { LibraryShelve } from "../../../components/logo/BookLogo";
import libraryShelve from "../../../assets/images/library-shelve.jpg";

const style = {
  width: "60%",
  height: "60%",
};
const CardItem = (props) => {
  return (
    <div className="card card-md">
      <ing src={libraryShelve} alt="logo" style={style} />
      <span className="label">{props.item.label}</span>
      <span className="value">{props.item.value}</span>
    </div>
  );
};

export default CardItem;
